import React from "react";
import BodyContainer from "../components/BodyContainer";
import FlexBox from "../components/FlexBox";
import { videoData } from "./api";

const MainPage = () => {
    async function fetchVideoData() {
        try {
            const data = await videoData(); // 비디오 데이터를 가져옵니다.
            console.log(data); // 가져온 데이터를 콘솔에 출력합니다.
            // 여기에서 데이터를 페이지에 표시하거나 다른 작업을 수행할 수 있습니다.
        } catch (error) {
            console.error("Failed to fetch video data:", error); // 오류가 발생한 경우 오류를 콘솔에 출력합니다.
            // 오류 처리를 수행할 수 있습니다.
        }
    }

    console.log("^^fetchVideoData", fetchVideoData);
    return (
        <BodyContainer className="pt-[60px] md:pt-[100px]">
            <div className="mt-[40px] flex flex-col md:flex-row items-center">
                <span className="font-medium font-16 md:font-22 color-green-5e mr-[10px]">
                    Daily TIP.
                </span>
                <span className="font-medium md:font-16">
                    다가오는 장마철 천연 정화석을 구비하여 습기를 제거해보세요
                </span>
            </div>
            <FlexBox justify="space-between" align="center">
                <div className="md:font-22 color-green-5e font-medium">자취 정보 영상</div>
                <button className="font-medium">더 많은 영상보기</button>
            </FlexBox>
        </BodyContainer>
    );
};

export default MainPage;
